using System;
using System.Collections.Generic;
using System.Data;
using System.IO;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Xml;

namespace YuzTanima.Temel
{
    class Ayarlar
    {

        private static int sonId = 0;
        public static int SonId
        {
            get
            {
                return sonId;
            }

            set
            {
                sonId = value;
                Kaydet();
            }
        }

        public static string CalismaKlasoru
        {
            get
            {
                String belgelerim = Environment.GetFolderPath(Environment.SpecialFolder.MyDocuments);
                return Path.Combine(new string[]
                {
                    belgelerim, "YuzTanima_Dosyalar"
                });
            }
        }

        private static string AyarDosyasi
        {
            get
            {
                return Path.Combine(new string[]
                {
                    CalismaKlasoru, "Ayarlar.dat"
                });
            }
        }

        public static void KlasorOlustur(Kisi kisi)
        {
            string klasor = Path.Combine(new string[]
            {
                CalismaKlasoru, "Kisiler", "kisi_" + kisi.Id
            });

            Directory.CreateDirectory(klasor);
        }

        private static void dizinleriKontrolEt()
        {
            if (!System.IO.Directory.Exists(CalismaKlasoru))
            {
                Directory.CreateDirectory(CalismaKlasoru);
                Kaydet();
            }

            var haarDosyasi = Path.Combine(new string[] { CalismaKlasoru, "frontalface_haar.xml" });
            if (!File.Exists(haarDosyasi))
            {
                StreamWriter sw = new StreamWriter(haarDosyasi);

                var haar_byte = Convert.FromBase64String(HAAR_B64);
                sw.Write(Encoding.ASCII.GetString(haar_byte, 0, haar_byte.Length));

                sw.Close();
            }
        }

        public static void Kaydet()
        {
            dizinleriKontrolEt();

            StreamWriter sw = new StreamWriter(AyarDosyasi);

            sw.WriteLine("SonId=" + SonId.ToString());

            sw.Close();
        }

        public static void Yukle()
        {
            dizinleriKontrolEt();

            if (!File.Exists(AyarDosyasi))
            {
                Kaydet();
            }

            StreamReader sr = new StreamReader(AyarDosyasi);

            while (!sr.EndOfStream)
            {
                string[] satir = sr.ReadLine().Trim().Split('=');
                for (var i = 0; i < satir.Length; i++)
                {
                    satir[i] = satir[i].Trim();
                }

                switch (satir[0])
                {
                    case "SonId":
                        sonId = int.Parse(satir[1]);
                        break;
                }
            }

            sr.Close();
        }

        private static string HAAR_B64 = "";

    }
}
